import logo from "./logo.svg";
import "./App.css";
import Child from "./child.js";

function App() {
  const text = "인프런 수강생 여러분 화이팅";
  const say = function () {
    return <h3>인프런 강의 너무 좋아</h3>;
  };
  const sayhello = function () {
    alert("안녕하세요");
  };
  return (
    <div>
      <h1>안녕하세요</h1>
      <h2>{text}</h2>
      <div
        onClick={function () {
          alert("안녕");
        }}
      >
        클릭해주세요
      </div>
      {say()}
      <Child name="하연" age={11} />
      <Child name="하영" age="23" />
      <Child name="지원" age={14} />
    </div>
  );
}

export default App;
